import React from "react";
import ReactDOM from "react-dom";
import 'index.css';


function App(){
  return (
    <main>
      <section className="container">
        <h3>0 birthdays today</h3>
        <button>Clear All</button>
      </section>
    </main>
  )
}

ReactDOM.render(<App/>,document.getElementById('root'));
